import React from 'react';

function Main(){

    return(
        <div>
                 {/* next Container */}
                 <h1>Hello this is the page!</h1>
            <div className = "container resultcontainer"  id="resulttab"style = "display: block;">
                <div className = "row">
                        <div className = 'col-6 ' >
                            <h1>Today's Weather!</h1>
                            {/* <u style = "font-size: 25px;font-weight: bold;display:inline">Location:</u><h3 className = "locat" style="display: inline;"></h3></br></br>
                            <u style = "font-size: 25px;font-weight: bold;display:inline">Current Temperature:</u><h3 className = "curr_temp" style="display: inline;"></h3></br></br>
                            <u style = "font-size: 25px;font-weight: bold;display:inline">Humidity:</u><h3 className = "hum" style="display: inline;"></h3></br></br>
                            <u style = "font-size: 25px;font-weight: bold;display:inline">Description:</u><h3 className = "ppt" style="display: inline;"></h3></br> */}
                    
                            <form className = "check">
                                <button type="submit" className="btn btn-primary" id = "back">  Back  </button>
                            </form>
                            
                        </div>
                        <div className = "col-6" id="ig">
                            
                        </div>
                </div>
            </div>
        </div>
    )
}
export default Main;
